import React from 'react'
import { TextField } from '@material-ui/core'

function StoryField() {
    return (
        <div style={{ textAlign: "center", margin: "0 auto", width: "40%", height: "50vh" }}>
            <TextField />
            <TextField multiline variant="outlined" style={{ width: "98%" }} rows="15" />
        </div>

    )
}

export default StoryField
